(()=>{let a,t;self.onmessage=e=>{if("canvas"in e.data)a=e.data.canvas,t=a.getContext("2d"),t.imageSmoothingEnabled=!1;else if("pixels"in e.data){const{pixels:s,rows:n,cols:o}=e.data;a.width=o,a.height=n;const d=t.createImageData(o,n);for(let a=0;a<s.length;a++){const t=a%o,e=4*(Math.floor(a/o)*o+t),n=s[a];d.data[e]=n.r,d.data[e+1]=n.g,d.data[e+2]=n.b,d.data[e+3]=255}t.putImageData(d,0,0)}}})();